import React from 'react';
import styled from 'styled-components';
import { TodoItem } from './todo.model';
import { Button, Checkbox } from '@mui/material';
interface TodoProps {
    todo: TodoItem;
    deleteTodo: () => void;
    statusTodo: () => void;
}

function Todo ({ todo, deleteTodo, statusTodo }: TodoProps) {

   
    


    return (
        <div>
          <Checkbox onChange={statusTodo}/>
            <h3>{todo.title}</h3>

            <button >Edit</button>
            <Button  onClick={deleteTodo} color='error'>Delete</Button>
        </div>
    );
}

export default Todo;
